import React from "react";
import Nav from "./Nav";
import Link from "next/link";
import styled from "styled-components";

const Logo = styled.h1`
	background: red;
`;

function Header() {
	return (
		<header>
			<div className="bar">
				<Link href="/">
					<Logo>Sick fits</Logo>
				</Link>
			</div>

			<div className="sub-bar">
				<p>Search</p>
			</div>
			<Nav />
		</header>
	);
}

export default Header;
